import './navbar.component.css';

function Navbar() {
  const navbarName = 'I am the navbar';
  return (    
    <div class="navbar">
      <p>{navbarName}</p>
      <img src="./../media/icons/cat.svg" alt="black cat" class="nav-img"></img>
    </div>
  );
}

export default Navbar;
